      primary: {
        main: "#FFF",
        darker: "#FFF",
      },
      neutral: {
        main: "#64748B",
        contrastText: "#fff",
      },
    },
  });

  const navigate = useNavigate();

  return (
    <header>
      <ThemeProvider theme={theme}>
